class Module {
  String? xformId;
  String? name;
  String? imgId;
  List<Module>? children;
  Label? label;
  List<CatchmentArea>? catchmentArea;
  String? listId;
  String? type;
  int? id;

  Module({
      this.xformId, 
      this.name, 
      this.imgId, 
      this.children, 
      this.label, 
      this.catchmentArea, 
      this.listId, 
      this.type, 
      this.id});

  Module.fromJson(dynamic json) {
    xformId = json["xform_id"].toString();
    name = json["name"];
    imgId = json["img_id"].toString();
    if (json["children"] != null) {
      children = [];
      json["children"].forEach((v) {
        children!.add(Module.fromJson(v));
      });
    }
    label = json["label"] != null ? Label.fromJson(json["label"]) : null;
    if (json["catchment_area"] != null) {
      catchmentArea = [];
      json["catchment_area"].forEach((v) {
        catchmentArea?.add(CatchmentArea.fromJson(v));
      });
    }
    listId = json["list_id"].toString();
    type = json["type"].toString();
    id = json["id"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["xform_id"] = xformId;
    map["name"] = name;
    map["img_id"] = imgId;
    if (children != null) {
      map["children"] = children?.map((v) => v.toJson()).toList();
    }
    if (label != null) {
      map["label"] = label!.toJson();
    }
    if (catchmentArea != null) {
      map["catchment_area"] = catchmentArea?.map((v) => v.toJson()).toList();
    }
    map["list_id"] = listId;
    map["type"] = type;
    map["id"] = id;
    return map;
  }

}